text:
@NumberShapes @JasonUnderdown @knowledgehook @theresawills That's a good one because there are almost no "extra" segments, except for the extra orange at 2468 and at 2470. (And there's an extra red sector at 2470, though that doesn't bother me as much). 

How few extra segments is it possible to get? 
i.e. R x O, R X G, R x B, R x P?

@asusarla What's crazy is that when I want to make sure I'm accurate, I think

16 x 24 = (20 - 4)x(20+4) = 20x20 - 4x4 = 400 - 16 = 384.

Only works sometimes, but it sure works here.

